import React from "react";
import { Link } from "react-router-dom";
import "./Footer.css";

function Footer() {
  return (
    <footer>
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">
            Please Reach Out for Current Availability
          </h5>
          <Link to="/contact-page" className="btn">
            Contact
          </Link>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
